import React from "react";
import "./Topnav.css";
import logo from "../images/logo.png";
import CallIcon from "@material-ui/icons/Call";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import Link from "@material-ui/core/Link";


function Topnav() {
  return (
    <div className='topnav border-bottom shadow-sm'>
      <div className='container'>
        <div className='row align-items-center pt-2'>
          <nav className='navbar p-0'>
            <a className='navbar-brand' href='/'>
              <img
                className='d-inline-block align-top'
                src={logo}
                alt='Passaggregate logo'
              />
            </a>
          </nav>
          <div
            className='d-flex flex-row align-items-center mx-auto'
          >
            <Typography>Enquiries : </Typography>
            <Link href="tel:+2348062820377">
              <IconButton>
                <CallIcon />
              </IconButton>
            </Link>

            <a>
              <IconButton color='primary' aria-label='call' border={0}>
                <CallIcon />
              </IconButton>
            </a>

            <IconButton>
              <CallIcon />
            </IconButton>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Topnav;
